INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('support_groups', NULL, 'Support groups for caregivers', NULL, NULL, 'Support groups focus on different aspects such as dealing with grief, the challenges of caring for a parent or a spouse or changes in lifestyle due to retirement.', NULL, 'Support groups are held for caregivers of people with Alzheimer''s Disease, other dementias, and any other illness your loved one is facing. These groups provide vital links to other caregivers and an opportunity to learn more about Alzheimer''s disease and other illnesses. Members of a support group usually share their personal experiences and offer one another emotional comfort and moral support. They may also offer practical advice and tips to help you cope with your situation.', 'You can find support groups through your local area agency on aging', NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('food_stamps', NULL, 'Food stamp program', NULL, NULL, NULL, NULL, 'Millions of older adults are eligible for food assistance from SNAP, the Supplemental Nutrition Assistance Program. See if you qualify and learn how SNAP can help pay for food and ensure good nutrition as you age. ', 'Application guidelines are detailed here: https://www.ncoa.org/older-adults/benefits/food-assistance/snap', NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('training', NULL, 'Caregiver training', NULL, NULL, NULL, NULL, 'A service that provides family caregivers with instruction to improve knowledge and performance of specific skills relating to caregiving. Skills may include activities related to health, nutrition, and financial management; providing personal care; and communicating with health care providers and other family members. More information: https://m4a.org/service/service/caregiver-support-alabama-cares/', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('infrastr_chgs', NULL, 'Accessibility improvements to home', 'N ', NULL, NULL, NULL, 'Homes can be modified to be be safer and support seniors mobility challenges.  Communities provide resources and some constractors specialize the addition of ramps, show handles and other enabling structures.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('home_maintain', NULL, 'Assistance with free or low cost home maintenance services', NULL, NULL, NULL, NULL, 'Churches and local organizations can assist with home maintenance tasks such as lawn care and small repairs.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('drug_assist', NULL, 'Assistance with cost of medications', NULL, NULL, NULL, NULL, 'Senior RX<br>Help in attaining free medication for uninsured or under-insured, low-income seniors age 55 and older and people with disabilities of any age. ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('counseling', NULL, 'Counseling', NULL, NULL, NULL, NULL, 'Aging includes life changes and transitions, like retirement, that you may want to talk to someone about. Counselors help tackle issues such as dealing with grief, serious illness and adjusting to retirement.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('reimbursement', NULL, 'Sources of full or partial financial assistance for items or services', NULL, NULL, NULL, NULL, 'Some services can be partially or fully funded by a third party organizations. Medicare reimburses for in home help.  Other agencys that are state funded provide services free of charge.  ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('medicare', NULL, 'Medicare and medicare supplements part C and part D', NULL, NULL, NULL, NULL, 'Medicare supplements extend partial coverage to drugs, glasses, dentures and hearing aids.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('house_cleaning', NULL, 'House keeping services', NULL, NULL, NULL, NULL, 'Tasks such as mopping, dusting and fixture cleaning may be easier for someone without mobility deficits.  Staying in your home may be easier with house keeping assistance.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('personal_care', NULL, 'Personal care services', NULL, NULL, NULL, NULL, 'Personal care assistants focus on hygience activities such as bathing and tolieting. They are scheduled to come to the home based on individual needs.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('home_meals', NULL, 'In home prepared meal delivery', NULL, NULL, NULL, NULL, 'When cooking daily gets challenging, prepared meals can be delivered by meals on wheels or other community organizations.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('daycare', NULL, 'Reoccuring or scheduled in home or out of home caregiving', NULL, NULL, NULL, NULL, 'Many caregivers work outside of the home.  In these cases, seniors can spend the day in a center that provides activity programming.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('respite_care', NULL, 'As needed in home care giving', NULL, NULL, NULL, NULL, 'Caregivers can get temporary in home care.  This service enables caregivers to attend to personal needs.  This care is vital in maintaining the mental health of full time caregivers. ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('incontinence_items', NULL, 'Incontinence products incl diapers and wipes', NULL, NULL, NULL, NULL, 'Incontinence items can be obtained from local and state organizations either free of charge or at a reduced cost.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('medical_supplies', NULL, 'Consumable medical supplies', NULL, NULL, NULL, NULL, 'Medical supplies include an consumable medical items such as dressings, catheters, syringes and sharps containers.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('nursing', NULL, 'In home nursing services', NULL, NULL, NULL, NULL, 'In home nusing services are provided when a senior is home bound and/or needs frequent skilled medical care.  It can include drawing blood for labs, weight checks and IV medication adminsitration.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('medic_alerting', NULL, 'Emergency alert systems incl medic alert', NULL, NULL, NULL, NULL, 'Medica alerts are wearable devices that seniors can uses to call for help in an emergency', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('durable_equip', NULL, 'Durable medical equipment incl bedside comode wheel chairs and walkers', NULL, NULL, NULL, NULL, 'Medicare will provide durable medical equipment that is prescribed by your doctor including walkers, wheel chairs, bedside commodes and hospital beds. ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('bill_assist', NULL, 'Assistance with utility bills', NULL, NULL, NULL, NULL, 'Assistance with costs associated with a senior is available.  Communities and non-profits provide utility bill assistance.  The application procedures are specific to that otganization ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('supplier_research', NULL, 'Reviews certification and training of service providers', NULL, NULL, NULL, NULL, 'As seniors age, caregivers often must identify in home assistance.  The quality of these providers can vary.  There are guidelines we can share on how to evaulate potential providers.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('medicare_providers', NULL, 'Professionals that are registered with the Medicare program to provide services', NULL, NULL, NULL, NULL, 'Any organization that seeks to be reimbursed by the medicare program must be registered and certified by medicare.  The only exception is the medicare waiver program.  In cases where a certified provider cannot be identified, it is possible to have a loved one reimbursesd for care.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('geriatricians', NULL, 'Geriatric doctors that specialize in the care of seniors', NULL, NULL, NULL, NULL, 'Doctors that specialize in issues specific to seniors', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('psychiatrist', NULL, 'Psychiatrists and psychologists to provide mental care', NULL, NULL, NULL, NULL, 'Doctors and counselors that specialize in mental health related issues', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('neurologists', NULL, 'Neurologists specalize in disorders of the brain or neurological system', NULL, NULL, NULL, NULL, 'Doctors that specialize in neurolical conditions including alzheimers and other dementias, stroke related deficits and cancers affecting the neurological system. ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('specialists', NULL, 'Specialists that focus on deseases of specific body systems like kidneys urinary tract etc', NULL, NULL, NULL, NULL, 'Some doctors specialize in a subset of diseases and disorders.  These doctors can provide a unique perspective treatments and outcomes.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('nursing_home', NULL, 'Long-term residential facilities that provide 24 hour skilled nursing care', NULL, NULL, NULL, NULL, 'Reddential faciltiies, often referred to as nursing homes, provide 24 hour skilled care to seniors.  Nursing homes are certified via Medicare.  Performance statistics are collected for every skilled residential facility.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('rehabilitation_facility', NULL, 'In patient rehabilitation faciltiy', NULL, NULL, NULL, NULL, 'Rehabilitation facilities are short term residential faciltiies that prepare seniors to return home by improving physical deficits through physical and occupational therapy ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('memory_care', NULL, 'Residential facilities where seniors live independently with significant support services ', NULL, NULL, NULL, NULL, 'Memory care enables seniors to live independently byt providing significant support services that can include housekeeping, reminders to take medication and meal services.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('legal_assist', NULL, 'Assistance with legal matters such as wills power of attorney etc', NULL, NULL, NULL, NULL, 'Many seniors will require legal services such as wills, power of attourney and management of estates.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('hospice_advd_care', NULL, 'Logistics and services available with hospice advanced care directives or end of life medical decisions', NULL, NULL, NULL, NULL, 'Advanced caare directives enable seniors to control how care is adminstered at the end of life.  Some seniors choose to not utilize certain life saving measure such as feeding tubes or prolonged attachment to ventilators once chances of recovery pypass a specific threshold.  Terminally ill patients can identify which codes will not be addressed.  Having these wishes spelled out in writing can provide peace of mind to patients and caregivers.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('transportation', NULL, 'Transportation to or from appointments shopping church etc', NULL, NULL, NULL, NULL, 'Transportation to doctor''s appointments, shopping or church may be available.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('death_burial', NULL, 'Death and burial related services', NULL, NULL, NULL, NULL, 'There are a range of burial services available.  Assistance with burial costs may be available.  Other tasks asscoiated with death include death certificates and settling of estates and resolving outstanding financial issues. ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('food_pantry', NULL, 'Food pantries and food banks', NULL, NULL, NULL, NULL, 'Most communities make groceries available via a food pantry. ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('physical_therapy', NULL, 'Physcial therapy to recover from injury', NULL, NULL, NULL, NULL, 'Physical therapy uses systematic exercises to improve the physical function of the patient.  The goal is to enable a patient to independently perform tasks.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('occupational_therapy', NULL, 'Occupational therapy to assist with improving performance of activities of daily living', NULL, NULL, NULL, NULL, 'Occupational therapists help patients to indepdently perform tasks of daily living using both systematic exercise and the use of approaches that consider any short or long term physcial deficits.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('devices_prosthetics', NULL, 'Medical devices prosthetics and orthotics like shoe inserts and wearable glucose monitor', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('studies_trials', NULL, 'Research studies and trials on disease intervention or understanding', NULL, NULL, NULL, NULL, 'Research studies focus on unproven therapies to address illness and disease.  They are not automatically better than the accepted standard of care.  However in some cases, where there are no good options, participation in a research study may provide additional options.  Participation in a study is governed by specific rules that safe guard the patient as much as possible.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('procedures', NULL, 'Out of home procedures like dialysis', NULL, NULL, NULL, NULL, 'Common procedures are interventional or diagnostic. Intervetional procedures improve function of injured systems (dialysis).  Diagnostic procedures can be invasive like surgery or non-invasive such as PET or CAT scans.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('illness_disease', NULL, 'Help with diagnosis', NULL, NULL, NULL, NULL, 'There are some illnesses and diseases that are more common later in life.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('vision_aids', NULL, 'Glasses and other aids to improve vision', NULL, NULL, NULL, NULL, 'Glasses and other visual aids can be obtained using medicare supplements or other funded programs. Some providers provide discounts to seniors.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('hearing_aids', NULL, 'Hearing aids', NULL, NULL, NULL, NULL, 'Hearing aids may be needed to improve hearing.  Doctors that specialize in hearing aids fabricate fitted hearing aids', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('oral_dentures', NULL, 'Oral prosthesis including dentures and implants', NULL, NULL, NULL, NULL, 'Dentures can be expensive.  Denture fabricators are rated.  There may be local providers that provide discounts.  ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('technology', NULL, 'Assistance with identifying and using technology  ', NULL, NULL, NULL, NULL, 'Seniors that can use technology as a resoruce have better health outcomes which can impove their quality of life.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('oxygen', NULL, 'Oxygen tanks concentrators etc', NULL, NULL, NULL, NULL, 'Some patients rely upon oxygen which is usually supplied by medical supply companies', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('referral', NULL, 'Assessment of needs and referral to many types of providers', NULL, NULL, NULL, NULL, 'Every community has an agency that can holistically evaulate each family and identifiy no or low cost solutions to common problems.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('medicare_waivers', NULL, 'Medicare waivers to pay services in the home', NULL, NULL, NULL, NULL, 'Provides services for elderly and disabled low-income people who without assistance might have to be cared for in a nursing home but choose to stay in their home.
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('food_vouchers', NULL, 'Food vouchers including senior promise market coupons', NULL, NULL, NULL, NULL, 'The goal of the Alabama Senior Farmers Market Nutrition Program (SFMNP) is to provide fresh nutritious locally-grown fresh fruits vegetables and herbs from farmers markets and roadside stands to low-income seniors. For more information about the program visit www.BuyLocalAlabama.com or call 1-877-774-9519. Applications must be completed online and will not be accepted by mail or over the phone.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('report_problem', NULL, 'Need to report a problem with an agency or a care provider', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('activity_enrichment', NULL, 'Local seniors centers and community centers provide exercise programs field trips and social actiivities', NULL, NULL, NULL, NULL, 'Commmunities plan activities to provide seniors with social interaction.  Silver sneakers is an example program that focuses on regular, group exercise.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('housing_directory', NULL, 'Housing directories', NULL, NULL, NULL, NULL, 'There are directories of housing targeted at seniors that continue to live independently.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('housing_assistance', NULL, 'Housing assistance', NULL, NULL, NULL, NULL, 'Communities and non-profit agencies can assist with finding affordable housing that is appropriate for caregivers and seniors including the availability of subsidized housing options ', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('veterans_affairs', NULL, 'Veterans affairs', NULL, NULL, NULL, NULL, 'Veterans affairs provides medical care for vets.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('financial_general', NULL, 'Financial general', NULL, NULL, NULL, NULL, 'Money and how to pay for the services a senior needs can be daunting.  There are a range of options that can either provide assistance or provide services free of charge.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('senior_discount', NULL, 'Senior Discount', NULL, NULL, NULL, NULL, 'Many organizations provide discounts for seniors on dining, entertainment, medical, groceries or household goods.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('job_training', NULL, 'Job Training', NULL, NULL, NULL, NULL, 'The Senior Community Service Employment Program (SCSEP) is a community service and work-based job training program for older Americans. Authorized by the Older Americans Act, the program provides training for low-income, unemployed seniors. Participants also have access to employment assistance through American Job Centers.  for more information: https://www.dol.gov/agencies/eta/seniors', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('substance_abuse', NULL, 'SUbstance abuse', NULL, NULL, NULL, NULL, 'Seniors are at a higher risk of substance abuse and substance abuse can have a more serious effect on the health of a senior.  As a recognized problem, there are programs that can assist with substance abuse issues.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('pain_management', NULL, 'Pain management', NULL, NULL, NULL, NULL, 'Seniors that are subject to chronic issues may need long term pain management.  Pain mangagement should be managed by a member of your medical team.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('tax_help', NULL, 'Tax help', NULL, NULL, NULL, NULL, 'Tax preparers often provide a discount for seniors.  Some tax preparers are familar with the unique needs of caregivers and seniors.', NULL, NULL);
INSERT INTO public.resource_categories (code, apply, description, evaluate, keywords, kinds, link, long_description, payment, process) VALUES ('clinics', NULL, 'Medical clinics', NULL, NULL, NULL, NULL, 'There are several types of clinic.  Most clinics are a group of doctors that share a privately owned office.  However some clinics are maintained by municipalities or counties.  All clinics include licensed general or specialized practitioners.', NULL, NULL);
